This tutorial works through the example at papyrus/examples/custom-cmds.rs . To begin, start a binary project with the following scaffolding in the main source code. We define a custom_cmds function that will be used to build our custom commands. To highlight the versatility of commands, the REPL is configured to have a persistent app data through a String. Notice also the method to alter the prompt name through the Builder::new method. #[macro_use]
extern crate papyrus; use papyrus::cmdtree::{Builder, BuilderChain};
use papyrus::cmds::CommandResult; # #[cfg(not(feature = "runnable"))]
# fn main() {} # #[cfg(feature = "runnable")]
fn main() { // Build a REPL that will use a String as the persistent app_data. let mut repl = repl!(String); // Inject our custom commands. repl.data.with_cmdtree_builder(custom_cmds()).unwrap(); // Create the persistent data. let mut app_data = String::new(); // Run the REPL and collect all the output. let output = repl.run(papyrus::run::RunCallbacks::new(&mut app_data)).unwrap(); // Print the output. println!("{}", output);
} // Define our custom commands.
// The CommandResult takes the same type as the app_data,
// in this instance it is a String. We could define it as
// a generic type but then it loses resolution to interact with
// the app_data through commands.
fn custom_cmds() -> Builder<CommandResult<String>> { // The string defines the name and the prompt that will be used. Builder::new("custom-cmds-app")
}

