Let's begin with a simple echo command. This command takes the data after the command and prints it to screen. All these commands will be additions to the Builder::new. Adding the following action with add_action method, the arguments are written to the Writeable writer. The REPL provides the writer and so captures the output. args is passed through as a slice of string slices, cmdtree provides this, and are always split on word boundaries. Finally, CommandResult::Empty is returned which papyrus further processes. Empty won't do anything but the API provides alternatives. # extern crate papyrus;
# use papyrus::cmdtree::BuilderChain;
# use papyrus::cmds::CommandResult;
# type Builder = papyrus::cmdtree::Builder<CommandResult<String>>;
Builder::new("custom-cmds-app") .add_action("echo", "repeat back input after command", |writer, args| { writeln!(writer, "{}", args.join(" ")).ok(); CommandResult::Empty }) .unwrap()
# ; Now when the binary is run the REPL runs as usual. If :help is entered you should see the following output. [lib] custom-cmds-app=> :help
help -- prints the help messages
cancel | c -- returns to the root class
exit -- sends the exit signal to end the interactive loop
Classes: edit -- Edit previous input mod -- Handle modules
Actions: echo -- repeat back input after command mut -- Begin a mutable block of code
[lib] custom-cmds-app=> The echo command exists as a root level action, with the help message displayed. Try calling :echo Hello, world! and see what it does!

